import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import PrmNavBar from "./PrmNavBar";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Button from 'react-bootstrap/Button';

class JiraScripts extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
        <div class="prm-background">
            <PrmNavBar></PrmNavBar>
            <div>
                <List >
                    <ListItem>
                        <Button href="http://localhost:3000//jirascripts/statistics/adcu_metrics" style={btnStyle}>Go</Button>
                        <ListItemText primary="Generate ADCU SW2 Metrics" secondary="" />
                    </ListItem>

                    <ListItem>
                        <Button href="#firstscript" style={btnStyle}>Go</Button>
                        <ListItemText primary="jira dummy" secondary="dummy info" />
                    </ListItem>

                </List>
            </div>
      </div>
    );
  }
}

const btnStyle={
    margin:10,
}

export default JiraScripts;
